import React, { Component } from 'react';
import '../styles/apicomp.css';

export default class ApiComp extends Component {
    render() {
        return (
            <section className="apiCompContainer">
                <h1>Todo List</h1>
                <div className="todoElements">
                    <input type="text" placeholder="Add todo" id="addTodo"></input>
                    <button className="todoButton" onClick={this.addTodo}>
                        Add
                    </button>
                </div>
            </section>
        );
    }
}
